import React, {Component} from 'react';
import {Link} from "react-router-dom";
import DocumentTitle from 'react-document-title'


class Vibor extends Component {
    render() {
        return (
            <DocumentTitle title = 'Военкомат'>
            <div>
                <h1>Военкомат Moscow</h1>
                <h2>Выберите кто вы</h2>
                <form action="http://localhost:3000/priziv/">
                    <input type="submit" name="hihshka" value="Военком" />
                </form>
                <form action="http://localhost:3000/priziv/">
                    <input type="submit" name="hihshka" value="Призывник" />
                </form>
                <Link to="/prizivniki">Посмотреть ассортимент!</Link>
            </div>


            </DocumentTitle>

        );
    }
}

export default Vibor;
